    <p class=MsoNormal><span style='font-size:22.0pt;line-height:105%;
    font-family:Algerian'>Oceanía&nbsp;es un&nbsp;<a
    href="https://es.wikipedia.org/wiki/Continente" title=Continente><span
    style='color:windowtext'>continente</span></a>&nbsp;<a

    style='color:windowtext'>plataforma continental de Australia</span></a>&nbsp;y
    los archipiélagos de&nbsp;<a href="https://es.wikipedia.org/wiki/Melanesia"

    style='color:windowtext'>Polinesia</span></a>. Históricamente se consideró
    que&nbsp;<span class=SpellE><a
    href="https://es.wikipedia.org/wiki/Insulindia" title=Insulindia><span
    style='color:windowtext'>Insulindia</span></a></span>&nbsp;también formaba
